        <hr/>
      </div>

      <div className="list">
        <h3>{글제목[1]}</h3>
        <p>{글내용[0]}</p>
        <hr/>
      </div>

      <div className="list">
        <h3>{글제목[2]}</h3>
        <p>{글내용[0]}</p>
        <hr/>
      </div>
    </div>
  );
}

export default App;
